description:
Verenigde Staten
Mystery / Thriller

een goeie film

met Lindsay Collins, Willa Ford en Angus Macfadyen

Claire Dennison is gelukkig getrouwd met Jonathan, maar de laatste tijd zijn er wat spanningen. Claire doet er alles aan om 
meer passie in hun liefdesleven te brengen. Op een avond verleidt ze een man van wie ze overtuigd is dat het Jonathan is. De 
mysterieuze man speelt het spel mee en ze beleven een gepassioneerde nacht. Na een tweede sensuele ontmoeting ontdekt Claire de 
schokkende waarheid; de man blijkt een geobsedeerde, manipulatieve psychopaat te zijn.
